import './Dashed.css';
import HeAd from './Head/Main';

// ReturnDashEd Component View
export default function ReturnDashEd() {

 const refContainer = React.useRef(null);
 React.useEffect(() => { refContainer.current.scrollIntoView({ behavior: "smooth" }); });


